import styled from "styled-components/native";

export const ContainerHeader = styled.View`
  width: 100vh;
`;

export const ContainerBack = styled.View`
  width: 25px;
  height: 25px;
  left: 35px;
  top: 35px;
  background: #E3E3E3;
  border-radius: 50px;
  justify-content: center;
  align-items: center;
  z-index: 3;
  cursor: pointer;
`;
